import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Take screenshot of mobile menu
    await page.waitForSelector('.mobile-menu', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_open.png'));

    // Click on "Your Profile" in the mobile menu
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Take screenshot after navigating to profile
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_navigated_to_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_navigated_to_profile.png'));

    // Close the mobile menu
    await page.click('.close-mobile-menu');

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation and verified profile access",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
